!(function (e) {
  console.log(
    "%c KKS ",
    "font-weight: bold; font-size: 50px;color: #ccc; text-shadow: 1px 1px 0 rgb(187 31 217 / 34%), 2px 2px 0 rgb(226 91 14 / 29%), 3px 3px 0 rgb(245 221 8 / 76%), 4px 4px 0 rgb(5 148 68 / 43%), 5px 5px 0 rgb(2 135 206 / 42%), 6px 6px 0 rgb(4 77 145 / 41%), 7px 7px 0 rgb(42 21 113 / 31%)"
  ),
    e("body").hide(),
    e
      .getJSON("../../assets/json/header.json", function (s) {
        const { logo: t, navBar: a, slider: l } = s.header;
        var o = e("#logo"),
          n =
            "/" === window.location.pathname ||
            "/index.html" === window.location.pathname;
        o.append(
          `<a class="navbar-caption text-white display-2" href="/index.html" ctrl=${
            t.text
          }>${
            t.logoPath
              ? `${
                  n ? `<img class="logo-top" src=${t.logoPath} />` : ""
                }<img class="logo-rest" src=${t.logoPath1} />`
              : t.text
          }</a>`
        );
        var i = e("#navbarSupportedContent ul"),
          d = e("#navbarSupportedContentScroll ul");
        for (var r in a) {
          var c = "",
            p = a[r];
          if (p.length > 0) {
            for (var m = "", h = 0; h < p.length; h++)
              m += `<a\n          class="text-white dropdown-item display-4"\n          aria-expanded="false"\n          href=${p[h].link}\n      >\n        ${p[h].type}\n        </a>`;
            c = `<li class="nav-item dropdown">\n          <a class="nav-link link text-white dropdown-toggle display-4" href="/" aria-expanded="false" data-toggle="dropdown-submenu">\n            ${r}\n          </a>\n          <div class="dropdown-menu">${m}</div>\n        </li>`;
          } else
            Array.isArray(p) ||
              (c = `<li class='nav-item'>\n          <a class='nav-link link text-white display-4' href=${
                n ? "" : "/"
              }${p.link}>\n            ${r}\n          </a>\n      </li>`);
          i.append(c), d.append(c);
        }
        var v = e("#custom-id-slider");
        if (l.length > 0) {
          var u = "";
          for (var r in l)
            u += `<div class="row ${l[r].className}-data">\n                <div class="custom-white col-md-12 col-lg-12 block-title">\n                    <div class="line line-title-big"></div>\n                    <h1 class="custom-section-title align-left custom-semibold pb-3 custom-fonts-style display-1">${l[r].sliderText}</h1>\n                    <div class="custom-section-btn align-left">\n                        <a class="btn btn-custom-outline display-7" href=${l[r].button.href}>${l[r].button.text}</a>\n                    </div>\n                </div>\n            </div>`;
        }
        v.prepend(u), e("body").show();
      })
      .fail(function () {
        return "An error has occurred.";
      }),
    setInterval(() => {
      var s = e(".custom-id-slider").hasClass("slider-1"),
        t = e(".custom-id-slider").hasClass("slider-2"),
        a = e(".custom-id-slider").hasClass("slider-3");
      s
        ? e(".custom-id-slider")
            .removeClass("slider-1")
            .addClass("slider-2")
            .fadeIn(1e3)
        : t
        ? e(".custom-id-slider")
            .removeClass("slider-2")
            .addClass("slider-3")
            .fadeIn(1e3)
        : a &&
          e(".custom-id-slider")
            .removeClass("slider-3")
            .addClass("slider-1")
            .fadeIn(1e3);
    }, 5e3),
    e(window).scroll(function () {
      document.body.offsetHeight / 2 < document.documentElement.scrollTop
        ? e("#back-to-top").addClass("active")
        : e("#back-to-top").removeClass("active");
    }),
    e("#back-to-top").on("click", () => {
      e("html, body").animate({ scrollTop: 0 }, 800);
    });
  document.getElementsByClassName("nav-link"),
    document.querySelectorAll("section");
  window.addEventListener("scroll", (s) => {
    let t = window.scrollY;
    e(".nav-link").each((e, s) => {
      let a = document.querySelector(s.hash);
      a && a.offsetTop <= t && a.offsetTop + a.offsetHeight > t
        ? s.classList.add("active")
        : s.classList.remove("active");
    });
  }),
    e("form input, form textarea").on("change", function () {
      "" !== e(this).val() && e(this).addClass("active");
    });
})(jQuery);
